import React from 'react';

function ArticleList({ articles, onSelect }) {
  return (
    <div>
      <h2>Articles</h2>
      <ul>
        {articles.map((a, index) => (
          <li key={index}>
            <button onClick={() => onSelect(a)}>
              {a.title} ({a.company})
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ArticleList;
